import React from 'react';
import { Dialog, DialogTitle, DialogContent, DialogActions, Button, Avatar, Typography, Box } from '@mui/material';

interface UserProfilePopupProps {
  user: {
    name?: string;
    profilePicture?: string;
  };
  open: boolean;
  onClose: () => void;
  onUpdateProfilePicture: (file: File) => void;
  onDeleteProfilePicture: () => void;
}

const UserProfilePopup: React.FC<UserProfilePopupProps> = ({ user, open, onClose, onUpdateProfilePicture, onDeleteProfilePicture }) => {
  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>User Profile</DialogTitle>
      <DialogContent>
        <Box display="flex" flexDirection="column" alignItems="center">
          <Avatar src={user.profilePicture || ''} alt={user.name || 'User'} sx={{ width: 100, height: 100 }} />
          <Typography variant="h6">{user.name || 'No Name Provided'}</Typography>
          {/* Add more user details if necessary */}
        </Box>
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="primary">Close</Button>
      </DialogActions>
    </Dialog>
  );
};

export default UserProfilePopup;
